import './Phone.css';
import { IoMdCall, IoMdCreate } from 'react-icons/io';
import Media from 'react-media';

// This is Name view 
export default function ReturnPhoneSetting() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-name-phone'>
  <div className='wrp-boxname-phone'>
   <IoMdCall size={'20px'} color={'grey'} />

   <div className='phone-name-identity'>
    <h1>Telephone</h1>
    <h2>{'+24381232383'}</h2>
    <p>lorem Out of the box you get access to all colors in the Material Design spec.</p>
   </div>

   <IoMdCreate size={'20px'} color={'#ffd600'} />
  </div>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-name-phone-sm'>
  <div className='wrp-boxname-phone-sm'>
   <IoMdCall size={'45px'} color={'grey'} />

   <div className='phone-name-identity-sm'>
    <h1>Telephone</h1>
    <h2>{'+243813434123'}</h2>
    <p>lorem Out of the box you get access to all colors in the Material Design spec.</p>
   </div>

   <IoMdCreate size={'45px'} color={'#ffd600'} />
  </div>

 </div>
);
